// src/helpers/payload.ts
import http2 from "http";
function generatePayload(statusCode, props) {
  const payload = {
    statusCode: 500,
    statusMessage: "",
    message: "",
    ok: false,
    data: null,
    pagination: null
  };
  const isOk = (statusCode2) => {
    const strStatusCode = statusCode2.toString();
    if (strStatusCode.startsWith("4") || strStatusCode.startsWith("5")) {
      return false;
    }
    return true;
  };
  payload.statusCode = statusCode;
  payload.statusMessage = http2.STATUS_CODES[statusCode] || "";
  payload.message = props?.message || "";
  payload.data = props?.data || null;
  payload.pagination = props?.pagination || null;
  payload.ok = isOk(statusCode);
  return payload;
}

